BEGIN TRANSACTION;
CREATE TABLE users (
	id CHAR(32) NOT NULL, 
	name VARCHAR(120) NOT NULL, 
	username VARCHAR(40) NOT NULL, 
	password BLOB NOT NULL, 
	is_active BOOLEAN NOT NULL, 
	is_admin BOOLEAN NOT NULL, 
	company_id CHAR(32), 
	PRIMARY KEY (id), 
	CHECK (is_active IN (0, 1)), 
	CHECK (is_admin IN (0, 1)), 
	FOREIGN KEY(company_id) REFERENCES company (id)
);
CREATE TABLE table_sizes (
	id INTEGER NOT NULL, 
	company_id CHAR(32), 
	size INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(company_id) REFERENCES company (id)
);
CREATE TABLE seating_preference (
	id CHAR(32) NOT NULL, 
	guest_id CHAR(32), 
	other_guest_id CHAR(32), 
	preference VARCHAR(7) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(guest_id) REFERENCES guest (id), 
	FOREIGN KEY(other_guest_id) REFERENCES guest (id), 
	CONSTRAINT seatingpreference CHECK (preference IN ('DISLIKE', 'LIKE'))
);
CREATE TABLE guest (
	id CHAR(32) NOT NULL, 
	number INTEGER NOT NULL, 
	last_name VARCHAR(50) NOT NULL, 
	first_name VARCHAR(50) NOT NULL, 
	title VARCHAR(150) NOT NULL, 
	event_id CHAR(32), 
	table_id CHAR(32), 
	PRIMARY KEY (id), 
	FOREIGN KEY(event_id) REFERENCES event (id), 
	FOREIGN KEY(table_id) REFERENCES event_table (id)
);
CREATE TABLE event_table (
	id CHAR(32) NOT NULL, 
	number INTEGER, 
	seating_capacity INTEGER, 
	event_id CHAR(32), 
	PRIMARY KEY (id), 
	FOREIGN KEY(event_id) REFERENCES event (id)
);
CREATE TABLE event (
	id CHAR(32) NOT NULL, 
	time DATETIME NOT NULL, 
	is_done BOOLEAN NOT NULL, 
	venue VARCHAR(150) NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	percent_extra_seats FLOAT NOT NULL, 
	customer_id CHAR(32), 
	company_id CHAR(32), 
	planner_id CHAR(32), 
	table_size_id INTEGER, 
	PRIMARY KEY (id), 
	CHECK (is_done IN (0, 1)), 
	FOREIGN KEY(customer_id) REFERENCES customer (id), 
	FOREIGN KEY(company_id) REFERENCES company (id), 
	FOREIGN KEY(planner_id) REFERENCES users (id), 
	FOREIGN KEY(table_size_id) REFERENCES table_sizes (id)
);
CREATE TABLE customer (
	id CHAR(32) NOT NULL, 
	number INTEGER, 
	name VARCHAR(200), 
	phone_number VARCHAR(26), 
	email VARCHAR(150), 
	company_id CHAR(32), 
	PRIMARY KEY (id), 
	FOREIGN KEY(company_id) REFERENCES company (id)
);
CREATE TABLE company (
	id CHAR(32) NOT NULL, 
	name VARCHAR(250) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE INDEX ix_guest_number ON guest (number);
CREATE INDEX ix_guest_event_id ON guest (event_id);
COMMIT;
